import { NavLink, useLocation } from "react-router-dom";
import facebook from "../assets/images/icons/facebook.png";
import email from "../assets/images/icons/arobase.png";
import location from "../assets/images/icons/location.png";
import birthday from "../assets/images/icons/birthday.png";
import hello from "../assets/images/icons/hello.png";
import change from "../assets/images/icons/change.png";
import www from "../assets/images/icons/www.png";
import users from "../components/Users";

export default function Profile() {
  const suzanne = users.find(user => user.name === "Suzanne");
  console.log(suzanne);

  return (
    <>
      <NavLink to="/">
        <div className="ml-20 mt-28 flex flex-row text-verydarkgray hover:opacity-80">
          &larr; Retour à l'accueil
        </div>
      </NavLink>
      <div className="container flex flex-col h-screen justify-center -mt-10 mx-auto ml-72">
        <div className="container flex flex-row mb-6">
          {/* Informations */}
          <div className="container w-[988px] h-[395px] flex flex-col bg-white rounded-3xl shadow-lg mr-5">
            <h3 className="mx-auto my-4 text-2xl">Mes informations:</h3>
            <p className="flex flex-row text-lg ml-40 mt-4 mb-3"><img src={email} className="mr-6" width={28} alt="adresse mail"></img> {suzanne.email}</p>
            <p className="flex flex-row text-lg ml-40 mb-3"><img src={location} className="mr-6" width={28} alt="localisation"></img>{suzanne.location}</p>
            <p className="flex flex-row text-lg ml-40 mb-3"><img src={birthday} className="mr-6" width={28} alt="anniversaire"></img>{suzanne.birthday}</p>
            <p className="flex flex-row text-lg ml-40 mb-3"><img src={hello} className="mr-6" width={28} alt="présentez-vous"></img>{suzanne.presentation}</p>
            <p className="flex flex-row text-lg ml-40 pl-1 mb-3"><img src={www} className="mr-7" alt="site web"></img><a href={suzanne.website}>{suzanne.website}</a></p>
            <p className="flex flex-row text-lg ml-40 pl-1 mb-3"><img src={facebook} className="mr-7" alt="Facebook" /><a href={suzanne.facebook}>{suzanne.facebook}</a></p>
          </div>
          {/* Avatar */}
          <div className="container flex flex-col w-[250px] h-[263px] bg-white rounded-3xl shadow-lg">
            <p className="mx-auto mt-3 font-semibold text-lg">{suzanne.name}</p>
            <div className="container w-[183px] h-[183px] bg-gray rounded-full mx-auto my-auto mt-2 shadow-sm overflow-hidden z-0">
              <img src={suzanne.image} alt={suzanne.name} />
            </div>
            <div className="flex flex-row">
              <img src={change} className="z-20 bottom-0 w-8 ml-48" alt="modifier le profil" />
              </div>
          </div>
        </div>
        {/* Offers list */}
        <div className="container w-[988px] h-[395px] flex flex-col bg-white rounded-3xl shadow-lg mr-5">
          <h3 className="mx-auto mt-4 text-2xl">Mes annonces:</h3>
        </div>
      </div>
    </>
  );
}
